import './App.css';
import Navbar from './Navbar'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import Couple from './img/yeniev.jpeg'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <img src={Couple} alt="img"/>
    </div>
  );
}

export default App;
